import React from 'react';
import ReactDOM from 'react-dom';
import {ReactComponent as SVGFloor1} from '../SVGs/floor1.svg'

const Hello = (
	<p>Hellow World!</p>
	);

const Floor1 = () => {
	return <SVGFloor1 />;
}

class Floor extends React.Component {
	constructor(svgplan, n, points) {
		super();
		this.plan = svgplan;
		this.position = n;
		this.points = points;
	}
	render() {
		return;
	}
}

class FloorPlan extends React.Component {
	constructor() {
		super();
		this.floors = [];
	}
	render() {
		return;
	}
}

ReactDOM.render(Hello,document.getElementById('root'));
